import React from 'react';
import {Container, Nav, Navbar} from "react-bootstrap";
import {BrowserRouter as Router, Routes, Route, Link, Switch} from "react-router-dom";
import App from "../App";
import TaskList from "./TaskList";

export default class Header extends React.Component{
    render(){
        return (
            <>
                <Router>
                <Navbar sticky="top" bg="dark" expand="lg" variant="dark">
                    <Container>
                        <Navbar.Toggle aria-controls="basic-navbar-nav" />
                        <Navbar.Collapse id="basic-navbar-nav">
                            <Nav className="me-auto">
                                <Nav.Link as={Link} to="/">Главная</Nav.Link>
                                <Nav.Link href="/request">Запросы</Nav.Link>
                                <Nav.Link href="/new-employee">Регистрация нового сотрудника</Nav.Link>
                                <Nav.Link href="/new-manager">Регистрация нового менеджера</Nav.Link>
                            </Nav>
                        </Navbar.Collapse>
                    </Container>
                </Navbar>


                    <Switch>
                        <Route exact path="/" element={<TaskList />}/>
                        <Route exact path="/request" element={<App/>}/>
                        <Route exact path="/new-employee" element={<App/>}/>
                        <Route exact path="/new-manager" element={<App/>}/>
                    </Switch>
                </Router>
            </>
        );
    }
}
